// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  // Import Routes and Route from react-router-dom
import Home from './pages/Home';  // Import Home component
import TrainSearch from './pages/TrainSearch';  // Import TrainSearch component
import Reservation from './pages/Reservation';  // Import Reservation component
import FAQ from './pages/FAQ';  // Import FAQ component
import './styles.css';


function App() {
  return (
    <Router>
      <Routes>  {/* Use Routes instead of Switch */}
        <Route path="/" element={<Home />} />  {/* Use element instead of component */}
        <Route path="/train-search" element={<TrainSearch />} />
        <Route path="/reservations" element={<Reservation />} />
        <Route path="/faq" element={<FAQ />} />
      </Routes>
    </Router>
  );
}

export default App;
